
This dataset comprises the raw exome sequencing data, SNP sets and InDel sets for 50 CHB patients and 40 healthy controls. The exome sequences were captured by NimbleGen2.1M array targeting 34 Mb of the human genome, containing 180,000 coding exons and 551 miRNA genes. The enriched library was then sequenced on Illumina HighSeq2000 and sequencing reads were aligned to human reference genome (NCBI build 36.3). The average sequencing depth per sample is 43X after the removal of read duplicates. These data provide a resource for identifying genetic variants predisposing humans to CHB infections.', 281320357888, 'ftp://climb.genomics.cn/pub/10.5524/100001_101000/100029/', 'Published', 'GigaDBUploadForm_HumanExome.xls', 'ad34b471dfc7a21a1d5164f43099e9e3', '2011/12/19', '2012/7/12', 1 );
